import './footer.css';

import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap';

import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';

const quick_links = [
    {
        path: '/home',
        display: 'Home',
    },
    {
        path: '/about',
        display: 'About',
    },
    {
        path: '/tours',
        display: 'Tours',
    },
];

const quick_links2 = [
    {
        path: '/gallery',
        display: 'Gallery',
    },
    {
        path: '/login',
        display: 'Login',
    },
    {
        path: '/register',
        display: 'Register',
    },
];

const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg="3">
                        <div className="logo">
                            <img src={logo} alt="" />
                            <p>
                                Lorem ipsum, dolor sit amet consectetur adipisicing elit. Ex atque eligendi animi id nam
                                officiis, amet dolores, nisi, voluptate eos eius. Velit recusandae tempore mollitia
                                corrupti ipsum eum dicta tenetur consequuntur magni hic architecto vitae doloribus
                                deleniti debitis, natus harum quae possimus, deserunt, voluptates facere? Iste animi
                                voluptates vitae dolore.
                            </p>
                        </div>
                    </Col>
                </Row>
            </Container>
        </footer>
    );
};

export default Footer;
